import test, { beforeEach } from 'node:test';
import assert from 'node:assert/strict';
import { readFileSync } from 'node:fs';
import { GET, __setPrismaLoaderForTest, normalizeAsset, resolvePriceSnapshots } from '../app/api/market/price-snapshots/route';

function assertNoProvablyFairFields(obj: unknown) {
  const json = JSON.stringify(obj);
  assert.equal(json.includes('serverSeed'), false);
  assert.equal(json.includes('clientSeed'), false);
  assert.equal(json.includes('commitHash'), false);
  assert.equal(json.includes('roundHash'), false);
}

type FakeRound = {
  id: string;
  asset: string;
  status: string;
  startedAt: Date;
  endedAt: Date | null;
  startPrice: unknown;
  endPrice: unknown | null;
};

type FakeSnapshot = {
  timestamp: Date;
  price: unknown;
  rowIndex: unknown;
};

function makeFakePrisma(args: {
  round: FakeRound | null;
  snapshots?: FakeSnapshot[];
  onArgs?: (calls: { findUnique?: any; findFirst?: any; findMany?: any }) => void;
}) {
  const calls: { findUnique?: any; findFirst?: any; findMany?: any } = {};

  const validateSelect = (queryArgs: any) => {
    const select = queryArgs?.select;
    if (!select) return;
    for (const bad of ['serverSeed', 'clientSeed', 'commitHash', 'roundHash']) {
      if (Object.prototype.hasOwnProperty.call(select, bad)) {
        throw new Error(`Provably-fair field must not be selected: ${bad}`);
      }
    }
  };

  const prisma = {
    round: {
      async findUnique(queryArgs: any) {
        calls.findUnique = queryArgs;
        validateSelect(queryArgs);
        return args.round;
      },
      async findFirst(queryArgs: any) {
        calls.findFirst = queryArgs;
        validateSelect(queryArgs);
        return args.round;
      },
    },
    priceSnapshot: {
      async findMany(queryArgs: any) {
        calls.findMany = queryArgs;
        validateSelect(queryArgs);
        return args.snapshots ?? [];
      },
    },
  };

  args.onArgs?.(calls);
  return { prisma, calls };
}

beforeEach(() => {
  // Default to a loader that fails loudly if a test forgets to set it.
  __setPrismaLoaderForTest(async () => {
    throw new Error('prismaLoader not set for test');
  });
});

test('schema.prisma: provably-fair fields removed', () => {
  const schema = readFileSync('prisma/schema.prisma', 'utf8');
  assert.equal(schema.includes('serverSeed'), false);
  assert.equal(schema.includes('clientSeed'), false);
  assert.equal(schema.includes('commitHash'), false);
  assert.equal(schema.includes('roundHash'), false);
});

test('normalizeAsset: accepts BTC, btc-usdt and defaults to BTCUSDT', () => {
  assert.equal(normalizeAsset(undefined), 'BTCUSDT');
  assert.equal(normalizeAsset(''), 'BTCUSDT');
  assert.equal(normalizeAsset('btc'), 'BTCUSDT');
  assert.equal(normalizeAsset('BTCUSDT'), 'BTCUSDT');
  assert.equal(normalizeAsset('btc-usdt'), 'BTCUSDT');
  assert.equal(normalizeAsset('BTC/USDT'), 'BTCUSDT');
});

test('resolvePriceSnapshots: returns null when no round exists', async () => {
  const { prisma } = makeFakePrisma({ round: null });
  const result = await resolvePriceSnapshots({ prisma: prisma as any, limit: 10 });
  assert.equal(result, null);
});

test('resolvePriceSnapshots: roundId path + timestamp filter -> stable output shape', async () => {
  const round: FakeRound = {
    id: 'r1',
    asset: 'BTCUSDT',
    status: 'RUNNING',
    startedAt: new Date(1000),
    endedAt: null,
    startPrice: '50000.25',
    endPrice: null,
  };

  const snapshots: FakeSnapshot[] = [
    { timestamp: new Date(1100), price: '50000.30', rowIndex: '6.5' },
    { timestamp: new Date(1200), price: '50000.35', rowIndex: '6.4' },
  ];

  const { prisma, calls } = makeFakePrisma({ round, snapshots });

  const result = await resolvePriceSnapshots({
    prisma: prisma as any,
    roundId: 'r1',
    limit: 2,
    from: 1050,
    to: 1300,
  });

  assert.ok(result);
  assert.equal(result.source, 'bybit');
  assert.equal(result.asset, 'BTCUSDT');
  assert.equal(result.round.id, 'r1');
  assert.equal(result.round.startedAt, 1000);
  assert.deepEqual(
    result.snapshots.map((s) => s.timestamp),
    [1100, 1200]
  );
  assert.equal(result.snapshots[0].price, 50000.3);
  assert.equal(result.snapshots[0].rowIndex, 6.5);
  assertNoProvablyFairFields(result);

  // Ensure we queried the right round id and applied timestamp filters.
  assert.equal(calls.findUnique?.where?.id, 'r1');
  assert.equal(calls.findMany?.where?.roundId, 'r1');
  assert.equal(calls.findMany?.where?.timestamp?.gte instanceof Date, true);
  assert.equal(calls.findMany?.where?.timestamp?.lte instanceof Date, true);
});

test('GET: rejects invalid query and does not touch prisma', async () => {
  __setPrismaLoaderForTest(async () => {
    throw new Error('should not load prisma on invalid query');
  });

  const res = await GET(new Request('http://localhost/api/market/price-snapshots?limit=0') as any);
  assert.equal(res.status, 400);
  const body = await res.json();
  assert.equal(typeof body.error, 'string');
});

test('GET: returns 404 when no rounds exist', async () => {
  __setPrismaLoaderForTest(async () => {
    const { prisma } = makeFakePrisma({ round: null });
    return prisma as any;
  });

  const res = await GET(new Request('http://localhost/api/market/price-snapshots?asset=BTC') as any);
  assert.equal(res.status, 404);
  const body = await res.json();
  assert.equal(body.error, 'No round found');
});

test('GET: returns round + snapshots and does not expose provably-fair fields', async () => {
  __setPrismaLoaderForTest(async () => {
    const { prisma } = makeFakePrisma({
      round: {
        id: 'r2',
        asset: 'BTCUSDT',
        status: 'BETTING',
        startedAt: new Date(2000),
        endedAt: null,
        startPrice: 51000,
        endPrice: null,
      },
      snapshots: [{ timestamp: new Date(2100), price: 51001, rowIndex: 6.49 }],
    });
    return prisma as any;
  });

  const res = await GET(new Request('http://localhost/api/market/price-snapshots?limit=10') as any);
  assert.equal(res.status, 200);
  const body = await res.json();

  assert.equal(body.source, 'bybit');
  assert.equal(body.round.id, 'r2');
  assert.deepEqual(body.snapshots.length, 1);
  assert.equal(body.snapshots[0].timestamp, 2100);
  assertNoProvablyFairFields(body);
});

/**
 * Market price snapshots API
 *
 * Transparent read-only endpoint for real-time-ish price history.
 * Data source: Bybit stream ingested by the game server and persisted as PriceSnapshot rows.
 */

import { NextRequest, NextResponse } from 'next/server';
import { z } from 'zod';

type RoundRow = {
  id: string;
  asset: string;
  status: string;
  startedAt: Date;
  endedAt: Date | null;
  startPrice: unknown;
  endPrice: unknown | null;
};

type SnapshotRow = {
  timestamp: Date;
  price: unknown;
  rowIndex: unknown;
};

export type PriceSnapshotsResponse = {
  asset: string;
  source: 'bybit';
  round: {
    id: string;
    status: string;
    startedAt: number;
    endedAt: number | null;
    startPrice: number;
    endPrice: number | null;
  };
  snapshots: Array<{
    timestamp: number;
    price: number;
    rowIndex: number;
  }>;
};

const QuerySchema = z.object({
  asset: z.string().optional(),
  roundId: z.string().optional(),
  limit: z.coerce.number().int().min(1).max(1000).optional().default(200),
  from: z.coerce.number().int().optional(),
  to: z.coerce.number().int().optional(),
});

export function normalizeAsset(raw: string | undefined): string {
  const trimmed = (raw ?? '').trim();
  if (!trimmed) return 'BTCUSDT';

  // Accept "BTC", "btc-usdt", "BTC/USDT" etc.
  const compact = trimmed.replace(/[^a-zA-Z0-9]/g, '').toUpperCase();
  if (compact.endsWith('USDT')) return compact;
  return `${compact}USDT`;
}

function toNumber(value: unknown): number {
  if (typeof value === 'number') return value;
  if (typeof value === 'string') return Number(value);
  if (value && typeof value === 'object') {
    const anyValue = value as { toNumber?: () => number; toString?: () => string };
    if (typeof anyValue.toNumber === 'function') return anyValue.toNumber();
    if (typeof anyValue.toString === 'function') return Number(anyValue.toString());
  }
  return Number(value);
}

export async function resolvePriceSnapshots(args: {
  prisma: {
    round: {
      findUnique: (args: unknown) => Promise<RoundRow | null>;
      findFirst: (args: unknown) => Promise<RoundRow | null>;
    };
    priceSnapshot: {
      findMany: (args: unknown) => Promise<SnapshotRow[]>;
    };
  };
  asset?: string;
  roundId?: string;
  limit: number;
  from?: number;
  to?: number;
}): Promise<PriceSnapshotsResponse | null> {
  const { prisma, roundId, limit } = args;
  const asset = normalizeAsset(args.asset);

  const round = roundId
    ? await prisma.round.findUnique({
        where: { id: roundId },
        select: {
          id: true,
          asset: true,
          status: true,
          startedAt: true,
          endedAt: true,
          startPrice: true,
          endPrice: true,
        },
      } as any)
    : await prisma.round.findFirst({
        where: { asset },
        orderBy: { startedAt: 'desc' },
        select: {
          id: true,
          asset: true,
          status: true,
          startedAt: true,
          endedAt: true,
          startPrice: true,
          endPrice: true,
        },
      } as any);

  if (!round) return null;

  const timestampFilter: Record<string, Date> = {};
  if (Number.isFinite(args.from)) timestampFilter.gte = new Date(args.from!);
  if (Number.isFinite(args.to)) timestampFilter.lte = new Date(args.to!);

  const snapshots = await prisma.priceSnapshot.findMany({
    where: {
      roundId: round.id,
      ...(Object.keys(timestampFilter).length > 0 ? { timestamp: timestampFilter } : null),
    },
    orderBy: { timestamp: 'asc' },
    take: limit,
    select: {
      timestamp: true,
      price: true,
      rowIndex: true,
    },
  } as any);

  return {
    asset: round.asset,
    source: 'bybit',
    round: {
      id: round.id,
      status: round.status,
      startedAt: round.startedAt.getTime(),
      endedAt: round.endedAt ? round.endedAt.getTime() : null,
      startPrice: toNumber(round.startPrice),
      endPrice: round.endPrice == null ? null : toNumber(round.endPrice),
    },
    snapshots: snapshots.map((s) => ({
      timestamp: s.timestamp.getTime(),
      price: toNumber(s.price),
      rowIndex: toNumber(s.rowIndex),
    })),
  };
}

async function loadPrisma() {
  // Lazy import so unit tests can import this module without a configured DATABASE_URL.
  const mod = await import('@/lib/prisma');
  return mod.default;
}

let prismaLoader: () => Promise<unknown> = loadPrisma;

// Test seam (kept tiny and isolated).
export function __setPrismaLoaderForTest(loader: () => Promise<unknown>) {
  prismaLoader = loader;
}

export async function GET(request: NextRequest) {
  try {
    const url = new URL(request.url);
    const parsed = QuerySchema.safeParse(Object.fromEntries(url.searchParams.entries()));
    if (!parsed.success) {
      return NextResponse.json(
        { error: 'Invalid query', details: parsed.error.flatten() },
        { status: 400 }
      );
    }

    const prisma = await prismaLoader();
    const data = await resolvePriceSnapshots({
      prisma: prisma as any,
      asset: parsed.data.asset,
      roundId: parsed.data.roundId,
      limit: parsed.data.limit,
      from: parsed.data.from,
      to: parsed.data.to,
    });

    if (!data) {
      return NextResponse.json({ error: 'No round found' }, { status: 404 });
    }

    return NextResponse.json(data);
  } catch (error) {
    console.error('[price-snapshots] GET failed:', error);
    return NextResponse.json({ error: 'Failed to load price snapshots' }, { status: 500 });
  }
}

import type { I18NConfig } from '../../config-shared'
import { NextURL } from '../next-url'
import { toNodeOutgoingHttpHeaders, validateURL } from '../utils'
import { RemovedUAError, RemovedPageError } from '../error'
import { RequestCookies } from './cookies'

export const INTERNALS = Symbol('internal request')

/**
 * This class extends the [Web `Request` API](https://developer.mozilla.org/docs/Web/API/Request) with additional convenience methods.
 *
 * Read more: [Next.js Docs: `NextRequest`](https://nextjs.org/docs/app/api-reference/functions/next-request)
 */
export class NextRequest extends Request {
  /** @internal */
  [INTERNALS]: {
    cookies: RequestCookies
    url: string
    nextUrl: NextURL
  }

  constructor(input: URL | RequestInfo, init: RequestInit = {}) {
    const url =
      typeof input !== 'string' && 'url' in input ? input.url : String(input)

    validateURL(url)

    // node Request instance requires duplex option when a body
    // is present or it errors, we don't handle this for
    // Request being passed in since it would have already
    // errored if this wasn't configured
    if (process.env.NEXT_RUNTIME !== 'edge') {
      if (init.body && init.duplex !== 'half') {
        init.duplex = 'half'
      }
    }

    if (input instanceof Request) super(input, init)
    else super(url, init)

    const nextUrl = new NextURL(url, {
      headers: toNodeOutgoingHttpHeaders(this.headers),
      nextConfig: init.nextConfig,
    })
    this[INTERNALS] = {
      cookies: new RequestCookies(this.headers),
      nextUrl,
      url: process.env.__NEXT_NO_MIDDLEWARE_URL_NORMALIZE
        ? url
        : nextUrl.toString(),
    }
  }

  [Symbol.for('edge-runtime.inspect.custom')]() {
    return {
      cookies: this.cookies,
      nextUrl: this.nextUrl,
      url: this.url,
      // rest of props come from Request
      bodyUsed: this.bodyUsed,
      cache: this.cache,
      credentials: this.credentials,
      destination: this.destination,
      headers: Object.fromEntries(this.headers),
      integrity: this.integrity,
      keepalive: this.keepalive,
      method: this.method,
      mode: this.mode,
      redirect: this.redirect,
      referrer: this.referrer,
      referrerPolicy: this.referrerPolicy,
      signal: this.signal,
    }
  }

  public get cookies() {
    return this[INTERNALS].cookies
  }

  public get nextUrl() {
    return this[INTERNALS].nextUrl
  }

  /**
   * @deprecated
   * `page` has been deprecated in favour of `URLPattern`.
   * Read more: https://nextjs.org/docs/messages/middleware-request-page
   */
  public get page() {
    throw new RemovedPageError()
  }

  /**
   * @deprecated
   * `ua` has been removed in favour of \`userAgent\` function.
   * Read more: https://nextjs.org/docs/messages/middleware-parse-user-agent
   */
  public get ua() {
    throw new RemovedUAError()
  }

  public get url() {
    return this[INTERNALS].url
  }
}

export interface RequestInit extends globalThis.RequestInit {
  nextConfig?: {
    basePath?: string
    i18n?: I18NConfig | null
    trailingSlash?: boolean
  }
  signal?: AbortSignal
  // see https://github.com/whatwg/fetch/pull/1457
  duplex?: 'half'
}

import type { OutgoingHttpHeaders } from 'http'
import type { DomainLocale, I18NConfig } from '../config-shared'
import type { I18NProvider } from '../lib/i18n-provider'

import { detectDomainLocale } from '../../shared/lib/i18n/detect-domain-locale'
import { formatNextPathnameInfo } from '../../shared/lib/router/utils/format-next-pathname-info'
import { getHostname } from '../../shared/lib/get-hostname'
import { getNextPathnameInfo } from '../../shared/lib/router/utils/get-next-pathname-info'

interface Options {
  base?: string | URL
  headers?: OutgoingHttpHeaders
  forceLocale?: boolean
  nextConfig?: {
    basePath?: string
    i18n?: I18NConfig | null
    trailingSlash?: boolean
  }
  i18nProvider?: I18NProvider
}

const REGEX_LOCALHOST_HOSTNAME =
  /(?!^https?:\/\/)(127(?:\.(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)){3}|\[::1\]|localhost)/

function parseURL(url: string | URL, base?: string | URL) {
  return new URL(
    String(url).replace(REGEX_LOCALHOST_HOSTNAME, 'localhost'),
    base && String(base).replace(REGEX_LOCALHOST_HOSTNAME, 'localhost')
  )
}

const Internal = Symbol('NextURLInternal')

export class NextURL {
  private [Internal]: {
    basePath: string
    buildId?: string
    flightSearchParameters?: Record<string, string>
    defaultLocale?: string
    domainLocale?: DomainLocale
    locale?: string
    options: Options
    trailingSlash?: boolean
    url: URL
  }

  constructor(input: string | URL, base?: string | URL, opts?: Options)
  constructor(input: string | URL, opts?: Options)
  constructor(
    input: string | URL,
    baseOrOpts?: string | URL | Options,
    opts?: Options
  ) {
    let base: undefined | string | URL
    let options: Options

    if (
      (typeof baseOrOpts === 'object' && 'pathname' in baseOrOpts) ||
      typeof baseOrOpts === 'string'
    ) {
      base = baseOrOpts
      options = opts || {}
    } else {
      options = opts || baseOrOpts || {}
    }

    this[Internal] = {
      url: parseURL(input, base ?? options.base),
      options: options,
      basePath: '',
    }

    this.analyze()
  }

  private analyze() {
    const info = getNextPathnameInfo(this[Internal].url.pathname, {
      nextConfig: this[Internal].options.nextConfig,
      parseData: !process.env.__NEXT_NO_MIDDLEWARE_URL_NORMALIZE,
      i18nProvider: this[Internal].options.i18nProvider,
    })

    const hostname = getHostname(
      this[Internal].url,
      this[Internal].options.headers
    )
    this[Internal].domainLocale = this[Internal].options.i18nProvider
      ? this[Internal].options.i18nProvider.detectDomainLocale(hostname)
      : detectDomainLocale(
          this[Internal].options.nextConfig?.i18n?.domains,
          hostname
        )

    const defaultLocale =
      this[Internal].domainLocale?.defaultLocale ||
      this[Internal].options.nextConfig?.i18n?.defaultLocale

    this[Internal].url.pathname = info.pathname
    this[Internal].defaultLocale = defaultLocale
    this[Internal].basePath = info.basePath ?? ''
    this[Internal].buildId = info.buildId
    this[Internal].locale = info.locale ?? defaultLocale
    this[Internal].trailingSlash = info.trailingSlash
  }

  private formatPathname() {
    return formatNextPathnameInfo({
      basePath: this[Internal].basePath,
      buildId: this[Internal].buildId,
      defaultLocale: !this[Internal].options.forceLocale
        ? this[Internal].defaultLocale
        : undefined,
      locale: this[Internal].locale,
      pathname: this[Internal].url.pathname,
      trailingSlash: this[Internal].trailingSlash,
    })
  }

  private formatSearch() {
    return this[Internal].url.search
  }

  public get buildId() {
    return this[Internal].buildId
  }

  public set buildId(buildId: string | undefined) {
    this[Internal].buildId = buildId
  }

  public get locale() {
    return this[Internal].locale ?? ''
  }

  public set locale(locale: string) {
    if (
      !this[Internal].locale ||
      !this[Internal].options.nextConfig?.i18n?.locales.includes(locale)
    ) {
      throw new TypeError(
        `The NextURL configuration includes no locale "${locale}"`
      )
    }

    this[Internal].locale = locale
  }

  get defaultLocale() {
    return this[Internal].defaultLocale
  }

  get domainLocale() {
    return this[Internal].domainLocale
  }

  get searchParams() {
    return this[Internal].url.searchParams
  }

  get host() {
    return this[Internal].url.host
  }

  set host(value: string) {
    this[Internal].url.host = value
  }

  get hostname() {
    return this[Internal].url.hostname
  }

  set hostname(value: string) {
    this[Internal].url.hostname = value
  }

  get port() {
    return this[Internal].url.port
  }

  set port(value: string) {
    this[Internal].url.port = value
  }

  get protocol() {
    return this[Internal].url.protocol
  }

  set protocol(value: string) {
    this[Internal].url.protocol = value
  }

  get href() {
    const pathname = this.formatPathname()
    const search = this.formatSearch()
    return `${this.protocol}//${this.host}${pathname}${search}${this.hash}`
  }

  set href(url: string) {
    this[Internal].url = parseURL(url)
    this.analyze()
  }

  get origin() {
    return this[Internal].url.origin
  }

  get pathname() {
    return this[Internal].url.pathname
  }

  set pathname(value: string) {
    this[Internal].url.pathname = value
  }

  get hash() {
    return this[Internal].url.hash
  }

  set hash(value: string) {
    this[Internal].url.hash = value
  }

  get search() {
    return this[Internal].url.search
  }

  set search(value: string) {
    this[Internal].url.search = value
  }

  get password() {
    return this[Internal].url.password
  }

  set password(value: string) {
    this[Internal].url.password = value
  }

  get username() {
    return this[Internal].url.username
  }

  set username(value: string) {
    this[Internal].url.username = value
  }

  get basePath() {
    return this[Internal].basePath
  }

  set basePath(value: string) {
    this[Internal].basePath = value.startsWith('/') ? value : `/${value}`
  }

  toString() {
    return this.href
  }

  toJSON() {
    return this.href
  }

  [Symbol.for('edge-runtime.inspect.custom')]() {
    return {
      href: this.href,
      origin: this.origin,
      protocol: this.protocol,
      username: this.username,
      password: this.password,
      host: this.host,
      hostname: this.hostname,
      port: this.port,
      pathname: this.pathname,
      search: this.search,
      searchParams: this.searchParams,
      hash: this.hash,
    }
  }

  clone() {
    return new NextURL(String(this), this[Internal].options)
  }
}

import type { DomainLocale } from '../../../server/config-shared'

export function detectDomainLocale(
  domainItems?: readonly DomainLocale[],
  hostname?: string,
  detectedLocale?: string
) {
  if (!domainItems) return

  if (detectedLocale) {
    detectedLocale = detectedLocale.toLowerCase()
  }

  for (const item of domainItems) {
    // remove port if present
    const domainHostname = item.domain?.split(':', 1)[0].toLowerCase()
    if (
      hostname === domainHostname ||
      detectedLocale === item.defaultLocale.toLowerCase() ||
      item.locales?.some((locale) => locale.toLowerCase() === detectedLocale)
    ) {
      return item
    }
  }
}

import type { NextPathnameInfo } from './get-next-pathname-info'
import { removeTrailingSlash } from './remove-trailing-slash'
import { addPathPrefix } from './add-path-prefix'
import { addPathSuffix } from './add-path-suffix'
import { addLocale } from './add-locale'

interface ExtendedInfo extends NextPathnameInfo {
  defaultLocale?: string
  ignorePrefix?: boolean
}

export function formatNextPathnameInfo(info: ExtendedInfo) {
  let pathname = addLocale(
    info.pathname,
    info.locale,
    info.buildId ? undefined : info.defaultLocale,
    info.ignorePrefix
  )

  if (info.buildId || !info.trailingSlash) {
    pathname = removeTrailingSlash(pathname)
  }

  if (info.buildId) {
    pathname = addPathSuffix(
      addPathPrefix(pathname, `/_next/data/${info.buildId}`),
      info.pathname === '/' ? 'index.json' : '.json'
    )
  }

  pathname = addPathPrefix(pathname, info.basePath)
  return !info.buildId && info.trailingSlash
    ? !pathname.endsWith('/')
      ? addPathSuffix(pathname, '/')
      : pathname
    : removeTrailingSlash(pathname)
}

/**
 * Removes the trailing slash for a given route or page path. Preserves the
 * root page. Examples:
 *   - `/foo/bar/` -> `/foo/bar`
 *   - `/foo/bar` -> `/foo/bar`
 *   - `/` -> `/`
 */
export function removeTrailingSlash(route: string) {
  return route.replace(/\/$/, '') || '/'
}

import { parsePath } from './parse-path'

/**
 * Adds the provided prefix to the given path. It first ensures that the path
 * is indeed starting with a slash.
 */
export function addPathPrefix(path: string, prefix?: string) {
  if (!path.startsWith('/') || !prefix) {
    return path
  }

  const { pathname, query, hash } = parsePath(path)
  return `${prefix}${pathname}${query}${hash}`
}

/**
 * Given a path this function will find the pathname, query and hash and return
 * them. This is useful to parse full paths on the client side.
 * @param path A path to parse e.g. /foo/bar?id=1#hash
 */
export function parsePath(path: string) {
  const hashIndex = path.indexOf('#')
  const queryIndex = path.indexOf('?')
  const hasQuery = queryIndex > -1 && (hashIndex < 0 || queryIndex < hashIndex)

  if (hasQuery || hashIndex > -1) {
    return {
      pathname: path.substring(0, hasQuery ? queryIndex : hashIndex),
      query: hasQuery
        ? path.substring(queryIndex, hashIndex > -1 ? hashIndex : undefined)
        : '',
      hash: hashIndex > -1 ? path.slice(hashIndex) : '',
    }
  }

  return { pathname: path, query: '', hash: '' }
}

import { parsePath } from './parse-path'

/**
 * Similarly to `addPathPrefix`, this function adds a suffix at the end on the
 * provided path. It also works only for paths ensuring the argument starts
 * with a slash.
 */
export function addPathSuffix(path: string, suffix?: string) {
  if (!path.startsWith('/') || !suffix) {
    return path
  }

  const { pathname, query, hash } = parsePath(path)
  return `${pathname}${suffix}${query}${hash}`
}

import { addPathPrefix } from './add-path-prefix'
import { pathHasPrefix } from './path-has-prefix'

/**
 * For a given path and a locale, if the locale is given, it will prefix the
 * locale. The path shouldn't be an API path. If a default locale is given the
 * prefix will be omitted if the locale is already the default locale.
 */
export function addLocale(
  path: string,
  locale?: string | false,
  defaultLocale?: string,
  ignorePrefix?: boolean
) {
  // If no locale was given or the locale is the default locale, we don't need
  // to prefix the path.
  if (!locale || locale === defaultLocale) return path

  const lower = path.toLowerCase()

  // If the path is an API path or the path already has the locale prefix, we
  // don't need to prefix the path.
  if (!ignorePrefix) {
    if (pathHasPrefix(lower, '/api')) return path
    if (pathHasPrefix(lower, `/${locale.toLowerCase()}`)) return path
  }

  // Add the locale prefix to the path.
  return addPathPrefix(path, `/${locale}`)
}

import { parsePath } from './parse-path'

/**
 * Checks if a given path starts with a given prefix. It ensures it matches
 * exactly without containing extra chars. e.g. prefix /docs should replace
 * for /docs, /docs/, /docs/a but not /docsss
 * @param path The path to check.
 * @param prefix The prefix to check against.
 */
export function pathHasPrefix(path: string, prefix: string) {
  if (typeof path !== 'string') {
    return false
  }

  const { pathname } = parsePath(path)
  return pathname === prefix || pathname.startsWith(prefix + '/')
}

import type { OutgoingHttpHeaders } from 'http'

/**
 * Takes an object with a hostname property (like a parsed URL) and some
 * headers that may contain Host and returns the preferred hostname.
 * @param parsed An object containing a hostname property.
 * @param headers A dictionary with headers containing a `host`.
 */
export function getHostname(
  parsed: { hostname?: string | null },
  headers?: OutgoingHttpHeaders
): string | undefined {
  // Get the hostname from the headers if it exists, otherwise use the parsed
  // hostname.
  let hostname: string
  if (headers?.host && !Array.isArray(headers.host)) {
    hostname = headers.host.toString().split(':', 1)[0]
  } else if (parsed.hostname) {
    hostname = parsed.hostname
  } else return

  return hostname.toLowerCase()
}

import { normalizeLocalePath } from '../../i18n/normalize-locale-path'
import { removePathPrefix } from './remove-path-prefix'
import { pathHasPrefix } from './path-has-prefix'
import type { I18NProvider } from '../../../../server/lib/i18n-provider'

export interface NextPathnameInfo {
  /**
   * The base path in case the pathname included it.
   */
  basePath?: string
  /**
   * The buildId for when the parsed URL is a data URL. Parsing it can be
   * disabled with the `parseData` option.
   */
  buildId?: string
  /**
   * If there was a locale in the pathname, this will hold its value.
   */
  locale?: string
  /**
   * The processed pathname without a base path, locale, or data URL elements
   * when parsing it is enabled.
   */
  pathname: string
  /**
   * A boolean telling if the pathname had a trailingSlash. This can be only
   * true if trailingSlash is enabled.
   */
  trailingSlash?: boolean
}

interface Options {
  /**
   * When passed to true, this function will also parse Nextjs data URLs.
   */
  parseData?: boolean
  /**
   * A partial of the Next.js configuration to parse the URL.
   */
  nextConfig?: {
    basePath?: string
    i18n?: { locales?: readonly string[] } | null
    trailingSlash?: boolean
  }

  /**
   * If provided, this normalizer will be used to detect the locale instead of
   * the default locale detection.
   */
  i18nProvider?: I18NProvider
}

export function getNextPathnameInfo(
  pathname: string,
  options: Options
): NextPathnameInfo {
  const { basePath, i18n, trailingSlash } = options.nextConfig ?? {}
  const info: NextPathnameInfo = {
    pathname,
    trailingSlash: pathname !== '/' ? pathname.endsWith('/') : trailingSlash,
  }

  if (basePath && pathHasPrefix(info.pathname, basePath)) {
    info.pathname = removePathPrefix(info.pathname, basePath)
    info.basePath = basePath
  }
  let pathnameNoDataPrefix = info.pathname

  if (
    info.pathname.startsWith('/_next/data/') &&
    info.pathname.endsWith('.json')
  ) {
    const paths = info.pathname
      .replace(/^\/_next\/data\//, '')
      .replace(/\.json$/, '')
      .split('/')

    const buildId = paths[0]
    info.buildId = buildId
    pathnameNoDataPrefix =
      paths[1] !== 'index' ? `/${paths.slice(1).join('/')}` : '/'

    // update pathname with normalized if enabled although
    // we use normalized to populate locale info still
    if (options.parseData === true) {
      info.pathname = pathnameNoDataPrefix
    }
  }

  // If provided, use the locale route normalizer to detect the locale instead
  // of the function below.
  if (i18n) {
    let result = options.i18nProvider
      ? options.i18nProvider.analyze(info.pathname)
      : normalizeLocalePath(info.pathname, i18n.locales)

    info.locale = result.detectedLocale
    info.pathname = result.pathname ?? info.pathname

    if (!result.detectedLocale && info.buildId) {
      result = options.i18nProvider
        ? options.i18nProvider.analyze(pathnameNoDataPrefix)
        : normalizeLocalePath(pathnameNoDataPrefix, i18n.locales)

      if (result.detectedLocale) {
        info.locale = result.detectedLocale
      }
    }
  }
  return info
}

export interface PathLocale {
  detectedLocale?: string
  pathname: string
}

/**
 * A cache of lowercased locales for each list of locales. This is stored as a
 * WeakMap so if the locales are garbage collected, the cache entry will be
 * removed as well.
 */
const cache = new WeakMap<readonly string[], readonly string[]>()

/**
 * For a pathname that may include a locale from a list of locales, it
 * removes the locale from the pathname returning it alongside with the
 * detected locale.
 *
 * @param pathname A pathname that may include a locale.
 * @param locales A list of locales.
 * @returns The detected locale and pathname without locale
 */
export function normalizeLocalePath(
  pathname: string,
  locales?: readonly string[]
): PathLocale {
  // If locales is undefined, return the pathname as is.
  if (!locales) return { pathname }

  // Get the cached lowercased locales or create a new cache entry.
  let lowercasedLocales = cache.get(locales)
  if (!lowercasedLocales) {
    lowercasedLocales = locales.map((locale) => locale.toLowerCase())
    cache.set(locales, lowercasedLocales)
  }

  let detectedLocale: string | undefined

  // The first segment will be empty, because it has a leading `/`. If
  // there is no further segment, there is no locale (or it's the default).
  const segments = pathname.split('/', 2)

  // If there's no second segment (ie, the pathname is just `/`), there's no
  // locale.
  if (!segments[1]) return { pathname }

  // The second segment will contain the locale part if any.
  const segment = segments[1].toLowerCase()

  // See if the segment matches one of the locales. If it doesn't, there is
  // no locale (or it's the default).
  const index = lowercasedLocales.indexOf(segment)
  if (index < 0) return { pathname }

  // Return the case-sensitive locale.
  detectedLocale = locales[index]

  // Remove the `/${locale}` part of the pathname.
  pathname = pathname.slice(detectedLocale.length + 1) || '/'

  return { pathname, detectedLocale }
}

import { pathHasPrefix } from './path-has-prefix'

/**
 * Given a path and a prefix it will remove the prefix when it exists in the
 * given path. It ensures it matches exactly without containing extra chars
 * and if the prefix is not there it will be noop.
 *
 * @param path The path to remove the prefix from.
 * @param prefix The prefix to be removed.
 */
export function removePathPrefix(path: string, prefix: string): string {
  // If the path doesn't start with the prefix we can return it as is. This
  // protects us from situations where the prefix is a substring of the path
  // prefix such as:
  //
  // For prefix: /blog
  //
  //   /blog -> true
  //   /blog/ -> true
  //   /blog/1 -> true
  //   /blogging -> false
  //   /blogging/ -> false
  //   /blogging/1 -> false
  if (!pathHasPrefix(path, prefix)) {
    return path
  }

  // Remove the prefix from the path via slicing.
  const withoutPrefix = path.slice(prefix.length)

  // If the path without the prefix starts with a `/` we can return it as is.
  if (withoutPrefix.startsWith('/')) {
    return withoutPrefix
  }

  // If the path without the prefix doesn't start with a `/` we need to add it
  // back to the path to make sure it's a valid path.
  return `/${withoutPrefix}`
}

import type { OutgoingHttpHeaders } from 'http'
import {
  NEXT_INTERCEPTION_MARKER_PREFIX,
  NEXT_QUERY_PARAM_PREFIX,
} from '../../lib/constants'

/**
 * Converts a Node.js IncomingHttpHeaders object to a Headers object. Any
 * headers with multiple values will be joined with a comma and space. Any
 * headers that have an undefined value will be ignored and others will be
 * coerced to strings.
 *
 * @param nodeHeaders the headers object to convert
 * @returns the converted headers object
 */
export function fromNodeOutgoingHttpHeaders(
  nodeHeaders: OutgoingHttpHeaders
): Headers {
  const headers = new Headers()
  for (let [key, value] of Object.entries(nodeHeaders)) {
    const values = Array.isArray(value) ? value : [value]
    for (let v of values) {
      if (typeof v === 'undefined') continue
      if (typeof v === 'number') {
        v = v.toString()
      }

      headers.append(key, v)
    }
  }
  return headers
}

/*
  Set-Cookie header field-values are sometimes comma joined in one string. This splits them without choking on commas
  that are within a single set-cookie field-value, such as in the Expires portion.
  This is uncommon, but explicitly allowed - see https://tools.ietf.org/html/rfc2616#section-4.2
  Node.js does this for every header *except* set-cookie - see https://github.com/nodejs/node/blob/d5e363b77ebaf1caf67cd7528224b651c86815c1/lib/_http_incoming.js#L128
  React Native's fetch does this for *every* header, including set-cookie.

  Based on: https://github.com/google/j2objc/commit/16820fdbc8f76ca0c33472810ce0cb03d20efe25
  Credits to: https://github.com/tomball for original and https://github.com/chrusart for JavaScript implementation
*/
export function splitCookiesString(cookiesString: string) {
  var cookiesStrings = []
  var pos = 0
  var start
  var ch
  var lastComma
  var nextStart
  var cookiesSeparatorFound

  function skipWhitespace() {
    while (pos < cookiesString.length && /\s/.test(cookiesString.charAt(pos))) {
      pos += 1
    }
    return pos < cookiesString.length
  }

  function notSpecialChar() {
    ch = cookiesString.charAt(pos)

    return ch !== '=' && ch !== ';' && ch !== ','
  }

  while (pos < cookiesString.length) {
    start = pos
    cookiesSeparatorFound = false

    while (skipWhitespace()) {
      ch = cookiesString.charAt(pos)
      if (ch === ',') {
        // ',' is a cookie separator if we have later first '=', not ';' or ','
        lastComma = pos
        pos += 1

        skipWhitespace()
        nextStart = pos

        while (pos < cookiesString.length && notSpecialChar()) {
          pos += 1
        }

        // currently special character
        if (pos < cookiesString.length && cookiesString.charAt(pos) === '=') {
          // we found cookies separator
          cookiesSeparatorFound = true
          // pos is inside the next cookie, so back up and return it.
          pos = nextStart
          cookiesStrings.push(cookiesString.substring(start, lastComma))
          start = pos
        } else {
          // in param ',' or param separator ';',
          // we continue from that comma
          pos = lastComma + 1
        }
      } else {
        pos += 1
      }
    }

    if (!cookiesSeparatorFound || pos >= cookiesString.length) {
      cookiesStrings.push(cookiesString.substring(start, cookiesString.length))
    }
  }

  return cookiesStrings
}

/**
 * Converts a Headers object to a Node.js OutgoingHttpHeaders object. This is
 * required to support the set-cookie header, which may have multiple values.
 *
 * @param headers the headers object to convert
 * @returns the converted headers object
 */
export function toNodeOutgoingHttpHeaders(
  headers: Headers
): OutgoingHttpHeaders {
  const nodeHeaders: OutgoingHttpHeaders = {}
  const cookies: string[] = []
  if (headers) {
    for (const [key, value] of headers.entries()) {
      if (key.toLowerCase() === 'set-cookie') {
        // We may have gotten a comma joined string of cookies, or multiple
        // set-cookie headers. We need to merge them into one header array
        // to represent all the cookies.
        cookies.push(...splitCookiesString(value))
        nodeHeaders[key] = cookies.length === 1 ? cookies[0] : cookies
      } else {
        nodeHeaders[key] = value
      }
    }
  }
  return nodeHeaders
}

/**
 * Validate the correctness of a user-provided URL.
 */
export function validateURL(url: string | URL): string {
  try {
    return String(new URL(String(url)))
  } catch (error: any) {
    throw new Error(
      `URL is malformed "${String(
        url
      )}". Please use only absolute URLs - https://nextjs.org/docs/messages/middleware-relative-urls`,
      { cause: error }
    )
  }
}

/**
 * Normalizes `nxtP` and `nxtI` query param values to remove the prefix.
 * This function does not mutate the input key.
 */
export function normalizeNextQueryParam(key: string): null | string {
  const prefixes = [NEXT_QUERY_PARAM_PREFIX, NEXT_INTERCEPTION_MARKER_PREFIX]
  for (const prefix of prefixes) {
    if (key !== prefix && key.startsWith(prefix)) {
      return key.substring(prefix.length)
    }
  }
  return null
}

